var cssList = '';

var availableChars = '1234567890qwertyuiopasdfghjklzxcvbnmQWERTYUIOPASDFGHJKLZXCVBNM-=[]\\{}|;\'":,./<>?!@#$%^&*()`~'.split('').concat(' ');

var typingDisplayL = null;
var previousContent = [];

